import React, { Component } from "react";
import "./node.css";

class Node extends Component {
  state = {};

  render() {
    let grids = [];
    for (let i = 0; i < 20; i++) {
      grids.push(<div class="grid-item"></div>);
    }

    return <div class="grid-container"></div>;
  }
}

export default Node;
